import styles from './styles'

export const BaseDropdownContainer = styled('div', styles.baseDropdownContainer)
export const BaseDropdownMenuContainer = styled(
  'div',
  styles.baseDropdownMenuContainer
)
// Item
export const BaseDropdownItemContainer = styled(
  'div',
  styles.baseDropdownItemContainer
)
export const BaseDropdownItemContent = styled(
  'div',
  styles.baseDropdownItemContent
)
export const BaseDropdownItemIcon = styled('div', styles.baseDropdownItemIcon)
